        style={{
        width: '18rem'
        }}
    >
        <CardTitle tag="h5">
        Special Title Treatment
        </CardTitle>
        <CardText>
        With supporting text below as a natural lead-in to additional content.
        </CardText>
        <Button color="primary">
        Go somewhere
        </Button>
    </Card>
  );
}

export default SiparisToplami;
